import React, { useContext, useEffect } from "react";
import Link from "next/link";
import { useRouter } from "next/router";
import { useEnv } from "./contexts/envContext";
import "../../public/static/css/navbar.scss";
import { useAuth } from "use-auth0-hooks";

const Navbar = () => {
  const { pathname, query } = useRouter();
  const { isAuthenticated, isLoading, login, logout, user } = useAuth();
  const statusUrl = useEnv();

  useEffect(() => {
    console.log("statusUrl");
  }, [statusUrl]);

  return (
    <header>
      <nav>
        <span className="homeBtnDiv">
          <Link href="/">
            <a className="homeBtn">Home</a>
          </Link>
        </span>
        {/* {!isLoading && isAuthenticated ? (
            <>
              <li>
                <button
                  onClick={() => logout({ returnTo: "http://localhost:3000" })}
                >
                  Logout
                </button>
              </li>
            </>
          ) : (
            <li>
              <button
                onClick={() =>
                  login({ appState: { returnTo: { pathname, query } } })
                }
              >
                Login
              </button>
            </li>
          )} */}
        {user && (
          <div>
            <span className="name">
              <p>{user.nickname}</p>
            </span>
            <span className="profileBtnDiv">
              <Link href="/profile">
                <a>
                  <img className="profileBtn" src={user.picture} />
                </a>
              </Link>
            </span>
          </div>
        )}
      </nav>
    </header>
  );
};

export default Navbar;
